import react from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';

import MainPage from './baseTheme/MainPage';
import './App.css';

function App() {
    return (
        <div className="app-container">
            <Router>
                <Switch>
                    <Route path="/home">
                        <MainPage />
                    </Route>
                </Switch>
            </Router>
        </div>
    );
}

export default App;
